import{_ as p}from"./person-42ce5a18.js";import{_ as e,X as a,Y as r,a0 as i}from"./framework-e45c54a7.js";const s="/images/编程导航.jpg",t="/images/生财有术.jpg",h="/images/临公子读者圈.jpg",n="/images/和阿猫一起成长.jpg",o="/images/愚公掘金.jpg",c="/images/鱼塘主升级圈.jpg",d="/images/成长觉醒笔记.jpg",g="/images/代码随想录.jpg",_={},m=i('<h1 id="副业社群评测分享" tabindex="-1"><a class="header-anchor" href="#副业社群评测分享" aria-hidden="true">#</a> 副业社群评测分享</h1><p><strong>Tips</strong>:以下说到的所以知识星球付费之后都有<strong>三天免费退款机会</strong>，所以说白了大家大可以通过这种手段进星球逛逛，<strong>白嫖</strong>星球内<strong>有价值内容</strong>。</p><p>但价值是这样的，你如果不行动、不付出，永远也感受不到价值的存在，这也是为什么有人加入后躺着等天上掉馅饼，结果没有，大骂智商税，而有人却能加入星球给自己创造上千上万的价值。</p><p><strong>风险提示</strong>:最近也关注到很多诈骗相关的信息，利用人们想迫切赚钱的心理，实施诈骗</p><p>所以大家在副业搞钱的路上一定留个心眼，有风险意识，有红线止损意识</p><p>同时也要多和身边的人聊，不要一意孤行，因为被骗的那些人往往是当局者迷</p><p>不被理解，以为其他人都是傻子，而自己即将飞黄腾达，最后幻想戳破，轻则沉沦，重则轻生</p><p>文归正题，我在星球里面获得的价值，后续也会持续更新。</p><p>至于哪些社群有切实帮助，哪些社群容易踩坑，我会在验证以下星球价值之后，也逐一推荐给大家。</p><p>同时之后也会加入观察更多的副业社群来为大家做测评，请大家期待。</p><p>话不多说，看社群推荐之前先加一波好友，右上角<strong>网页收藏不迷路</strong>：</p><img src="'+p+'" height="500"><h2 id="程序员鱼皮的《编程导航》" tabindex="-1"><a class="header-anchor" href="#程序员鱼皮的《编程导航》" aria-hidden="true">#</a> 程序员鱼皮的《编程导航》</h2><img src="'+s+'" height="500"><p>编程导航，星主网络ID是：程序员鱼皮，前腾讯程序员，现在已经离职创业了</p><p>我加他的原因在于我和他几乎是同一时间步入职场，我还比他多一个研究生</p><p>他还带领不少人入门编程并斩获 offer，B站有 50+w 粉丝，星球付费会员 1.6w+</p><p>在他身上我看到的是一个普通程序员逆袭的故事</p><p>光这份逆袭的价值能给到我的激励就已经足够我买单了</p><p>同时我也在星球里面 get 到了一些项目的经验，当然有人说这些经验自学也行</p><p>如何维护这么大一个付费社群，运营经验也是相当值得借鉴的</p><p>关键在于当一个人自学达到一定阶段之后，一定要跳出自学陷阱，要去多看看别人怎么学怎么做，才能迁移突破</p><p>星球里面也会不定期直播教大家如何做项目（重点方向是网站类项目，练手大厂各种技术栈）</p><p>前端涵盖 vue，react 等主流的开发框架，后端以 java 为主，也会有后端常用数据库、中间件的使用直播教程</p><p>当然更重要的是有一群志同道合的人一起学习讨论，才会让自己走得更快更远</p><h2 id="亦仁的《生财有术》" tabindex="-1"><a class="header-anchor" href="#亦仁的《生财有术》" aria-hidden="true">#</a> 亦仁的《生财有术》</h2><img src="'+t+'" height="500"><p>介绍后面的星球之前，先重点讲一下这个吧，因为这个星球是目前我进入的内容价值最高且最贵的一个星球，也是知识星球付费榜长期霸榜的一个社群</p><p>后面介绍的星球几乎都和这个星球有足够深度的链接，我在探索其他星球的时候，得到的信息都或多或少指向这个星球</p><p>如果把下面所有的星球比作工业的话，这个星球就是工业母机</p><p>这也是为什么我愿意付费的一大原因</p><p>星球价格不便宜，17 年开始，维护了 6 年时间，目前付费用户 4w+ 人，今年的续费率 70%，这个数据我并不怀疑有虚假成分</p><p>因为你入了星球就知道，内容太多，管理困难，也是一个星球可持续发展的一大难题，所以会尽可能控制人数，星主没有虚假的这个必要</p><p>大量的来自各行各业有项目、有想法、有实战的人都在这个星球里面</p><p>星主维护了三个特别有价值的内容板块</p><ol><li>精选创业项目，星友提供的项目实战、方法论或者其他有价值的干货（星主长期泡在里面提供认证）</li><li>风向标，由星友从各行各业自发地提供各种创业机会（星主长期泡在里面提供认证）</li><li>航海（也就是搞钱项目实战，有各个方向的创业项目）</li></ol><p>因为星主独特的激励机制，所以大家更愿意分享</p><p>而且很多项目往往是一个人有的赚，而一群人能赚更多的项目</p><p>这也是为什么大家愿意分享的一个重要原因</p><p>当然还有一些项目是创业者和平台对抗的，比如各媒体平台的流量分发</p><p>有的个人创业者由于触碰了平台规则，流量说被限就被限了</p><p>那一群人做这个项目就可以互相避坑（这也是风向标的一大中标内容）</p><h2 id="临公子的《临公子读者圈》" tabindex="-1"><a class="header-anchor" href="#临公子的《临公子读者圈》" aria-hidden="true">#</a> 临公子的《临公子读者圈》</h2><img src="'+h+'" height="500"><p>临公子读者圈，这是一个主打付费写作教学的社群，里面有很多打卡写作的小伙伴</p><p>只要坚持90天每天打卡，会全额返现，如果打卡断了，需要从 0 开始继续</p><p>所以一年能有好几次重来的机会</p><p>这个星球只要你在一年时间内坚持 90 天，基本上可以白嫖星球</p><p>应该是因为风格的缘故，星球内女性偏多，文字上偏感性，但也有很多不错的内容</p><p>付费打卡也是一个不错的经验，但前提还是需要提供诸如写作训练等价值干货</p><p>从 2 月开始我已经打卡两个半月了，很快就毕业，也期待你的加入~</p><h2 id="阿猫的《和阿猫一起成长》" tabindex="-1"><a class="header-anchor" href="#阿猫的《和阿猫一起成长》" aria-hidden="true">#</a> 阿猫的《和阿猫一起成长》</h2><img src="'+n+'" height="500"><p>和阿猫一起成长，这也是一个主打付费写作和知识类的社群，此前有 100 天持续打卡返现</p><p>但目前星主应该是取消返现，而是打卡成功后提供其他等价值的产品</p><p>这个星球和临公子星球可以同步打卡，相当不错的一份工作两份产出</p><p>而且阿猫的商业能力和执行力特别强，一旦有什么样的创造价值的机会就会立马拉群来碰撞</p><p>所以如果身边搞副业都是这么高能量的人，你也会变得高能量</p><h2 id="花爷的《愚公掘金》" tabindex="-1"><a class="header-anchor" href="#花爷的《愚公掘金》" aria-hidden="true">#</a> 花爷的《愚公掘金》</h2><img src="'+o+'" height="500"><p>从花爷的直播能看出来，这个人的逻辑能力和商业能力是很强的</p><p>目前我也在入群做一些星球内提供的副业赛道</p><p>看看是否好做以及是否会有一些结果</p><p>大家可以期待一下~</p><h2 id="鱼塘主的《鱼塘主升级圈》" tabindex="-1"><a class="header-anchor" href="#鱼塘主的《鱼塘主升级圈》" aria-hidden="true">#</a> 鱼塘主的《鱼塘主升级圈》</h2><img src="'+c+'" height="500"><p>介绍：TODO</p><h2 id="鱼塘主-阿猫的《成长觉醒笔记》" tabindex="-1"><a class="header-anchor" href="#鱼塘主-阿猫的《成长觉醒笔记》" aria-hidden="true">#</a> 鱼塘主+阿猫的《成长觉醒笔记》</h2><img src="'+d+'" height="500"><p>介绍：TODO</p><h2 id="carl-的《代码随想录》" tabindex="-1"><a class="header-anchor" href="#carl-的《代码随想录》" aria-hidden="true">#</a> carl 的《代码随想录》</h2><img src="'+g+'" height="500"><p>介绍：TODO</p>',73),l=[m];function f(u,x){return a(),r("div",null,l)}const O=e(_,[["render",f],["__file","sideline.html.vue"]]);export{O as default};
